import {makeStyles} from '@material-ui/core/styles'


const useStyles = makeStyles((theme)=>({
    box:{
        marginBottom:'20vh',
        overflow:'hidden'
    },
    h2:{
        color:'green',
        letterSpacing:'.4rem',
        textAlign:'center'
    },
    firstgrid:{
        marginBottom:'10vh'
    },
    lastgrid:{
        marginTop:'10vh'
    },
    btn:{
        color:'green',
        border:'1px solid green',
        background:'white',

        '&:hover':{
            color:'black',
            border:'1px solid black',
            background:'white'
        }
    }


}))

export default useStyles
